import { createRouter, createWebHistory } from 'vue-router';
import HomeView from '../views/managerView.vue';
import workerApplyHistory from '../components/worker/workerApplyHistory.vue';
import workerApply from '../components/worker/workerApply.vue';
import workerApplyStatistics from '../components/worker/workerApplyStatistics.vue';
import workerAccount from '../components/worker/workerAccount.vue';
import allWorkerStatisticsData from '../components/manager/allWorkerStatisticsData.vue';
import managerApprove from '../components/manager/managerApprove.vue';
const routes = [{
  path: '/login',
  name: 'login',
  component: () => import('../views/login.vue')
}, {
  path: '/manager',
  name: 'managerView',
  component: HomeView,
  children: [{
    path: 'allWorkerStatisticsData',
    component: allWorkerStatisticsData
  }, {
    path: 'managerApprove',
    component: managerApprove
  }]
}, {
  path: '/worker',
  name: 'workerView',
  component: () => import(
  /* webpackChunkName: "about" */
  '../views/workerView.vue'),
  children: [{
    path: 'account',
    component: workerAccount
  }, {
    path: 'applyHistory',
    component: workerApplyHistory
  }, {
    path: 'apply',
    component: workerApply
  }, {
    path: 'timePool',
    component: workerApplyStatistics
  }]
}];
const router = createRouter({
  history: createWebHistory(process.env.BASE_URL),
  routes
});
export default router;
